import React from "react";
import { Inject, ScheduleComponent, Day, Week, WorkWeek, Month, Agenda, EventSettingsModel} from '@syncfusion/ej2-react-schedule';
import { DataManager, WebApiAdaptor } from '@syncfusion/ej2-data';
import Navbar from "../Navbar";
import Footer from "../Footer";
import '../Calendar/Calendar.css';
import { DefaultLoadingManager } from "three";

class Calendar extends React.Component {
  localData: EventSettingsModel = {
    dataSource: [{
      EndTime: new Date(2021, 2, 21, 4, 30),
      StartTime: new Date(2021, 2, 21, 3, 0)
    }]
  };
  remoteData = new DataManager({
    url: 'https://js.syncfusion.com/demos/ejservices/api/Schedule/LoadData',
    adaptor: new WebApiAdaptor,
    crossDomain: true
  });
    render() {
      return (
      <>
      <Navbar/><br/><br/>
      <div className="calendar">
      <ScheduleComponent currentView='Month' selectedDate={new Date(2021, 1, 1)}
      eventSettings={{ dataSource: this.remoteData }}>
        <Inject services={[Day, Week, WorkWeek, Month, Agenda]} />
      </ScheduleComponent>
      </div>
      <Footer />
      </>
      );
   }
}

export default Calendar;
